import "./App.css";

const Sound = ({ play, sound: { id, icon, soundURL } }) => {
  return (
    <div className="button">
      <a href="#this" onClick={() => play(id)}>
        <audio id={id} src={soundURL} />
        <div className="emoji">
          <img alt="icon" width="120px" src={icon} />
        </div>
      </a>
    </div>
  );
};

export { Sound };
